description: '<p>The modelling results of Whitley et al. (2016), consisting of the
  models BESS, BIOS2, CABLE, LPJ-GUESS, MAESPA and SPA, for five sites along the North-Australian
  Tropical Transect.</p>


  <p><strong>References</strong><br>

  Whitley, R., Beringer, J., Hutley, L.B., Abramowitz, G., De Kauwe, M.G., Duursma,
  R., Evans, B., Haverd, V., Li, L., Ryu, Y., Smith, B., Wang, Y.-P., Williams, M.,
  Yu, Q., 2016. A model inter-comparison study to examine limiting factors in modelling
  Australian tropical savannas. Biogeosciences 13, 3245&ndash;3265. https://doi.org/10.5194/bg-13-3245-2016</p>


  <p>&nbsp;</p>'
